impl<const N: usize, T> Drop for RawIntoIter<N, T> {
    #[inline]
    fn drop(&mut self) {
        unsafe {
            // Drop all remaining elements
            self.inner.drop_elements(
                self.aligned_groups.as_ptr(),
                Bucket::from_base_index(NonNull::new_unchecked(self.data.as_ptr() as _), 0),
            );
        }
    }
}
